import React, {useContext, useEffect, useState} from "react";
import {Link} from "react-router-dom";


function GetPriziv(){
    const [priziv, setPriziv] = useState([]);

     useEffect(() => {
        fetch(`http://127.0.0.1:8000/prizivniki/`)
            .then(response => response.json())
            .then((result) => {
                setPriziv(result);
            })
    }, []);
}

function GetCart(){
    const [cart, setCart] = useState([]);

     useEffect(() => {
        fetch(`http://127.0.0.1:8000/cart/`)
            .then(response => response.json())
            .then((result) => {
                setCart(result);
            })
    }, []);
}

function Cart(){
    const priziv = GetPriziv()

    const del=(name)=> {
        console.log(name)
        fetch(`http://127.0.0.1:8000/cart/${name}`, {
            method: "DELETE",
        })
            .then(res => {
                if (res.ok) {
                    console.log("HTTP request successful");
                    window.location.reload();
                } else {
                    console.log("HTTP request unsuccessful");
                }
            })

    }

    return (
        <div>
            <a href={`../`}>Начало/</a>
            <a href={`/priziv/`}>Призывники/</a>
            <a href = {'/priziv/cart'}>Армия/</a>
            <br/>
            <h1>Список людей для отправки в армию</h1>
            {priziv ?.map(cart =>
                <div key = {cart.name} className="manga_block2">
                    <div className="image_wrapper">
                        <Link to={`/prizivniki/:rangeId${priziv[cart.name - priziv[0].id].id}`}>
                            <img className="manga_image" src={`${priziv[cart.name - priziv[0].id].image_path}`} />
                        </Link>
                    </div>
                    <Link className="manga_link" to={`/models/getbyid/${priziv[cart.name - priziv[0].id].id}`}>
                        {priziv[cart.name - priziv[0].id].name} {priziv[cart.name - priziv[0].id].vozrast}  ₽
                    </Link>
                    <br/>
                    <br/>
                    <input id="buy_button" className="buy_button" type="submit" value="Удалить" onClick={()=>{del(cart.id)}}/>

                </div>)}
            <button>Купить</button>
        </div>
    );
}
export default Cart;
